<script>

    let psi1 = false;
    let psi2 = false;
    let phi1 = false;
    let phi2 = false;

	function handleMouseOver(e) {
        let group = e.composedPath().find((element) => element.classList[0] == "node_g");

        if (group.id == "psi1") {
            psi1 = true;
        } else if (group.id == "psi2") {
            psi2 = true;
        } else if (group.id == "phi1") {
            phi1 = true;
        } else if (group.id == "phi2") {
            phi2 = true;
        }

	}
	function handleMouseOut(e) {
        let group = e.composedPath().find((element) => element.classList[0] == "node_g");

        if (group.id == "psi1") {
            psi1 = false;
        } else if (group.id == "psi2") {
            psi2 = false;
        } else if (group.id == "phi1") {
            phi1 = false;
        } else if (group.id == "phi2") {
            phi2 = false;
        }

    }
    
</script>


